import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Page1 from "./pages/page1"; // Adjust the import path accordingly
import Page2 from "./pages/blogs"; // Adjust the import path accordingly

function App() {
  return (
    <Router>
      <Routes>
        <Route exact path="/" element={<Page1 />} />
        <Route path="/blogs" element={<Page2 />} />
      </Routes>
    </Router>
  );
}

export default App;
